import React, { Component } from 'react';
import { Card, Table } from 'react-bootstrap';
import axios from 'axios';

export default class VoitureListe extends Component {
  constructor(props) {
    super(props);
    this.state = {
      voitures: []
    };
  }

  componentDidMount() {
    const voituresFactices = [
      { marque: 'Toyota', modele: 'Corolla', couleur: 'Bleu', annee: 2020, prix: 15000 },
      { marque: 'Honda', modele: 'Civic', couleur: 'Rouge', annee: 2019, prix: 14000 }
    ];
    this.setState({ voitures: voituresFactices });
  }
  

  render() {
    return (
      <Card className="border border-dark bg-dark text-white">
        <Card.Header>Liste Voitures</Card.Header>
        <Card.Body>
          <Table bordered hover striped variant="dark" responsive>
            <thead>
              <tr>
                <th>Marque</th>
                <th>Modèle</th>
                <th>Couleur</th>
                <th>Année</th>
                <th>Prix</th>
              </tr>
            </thead>
            <tbody>
              {this.state.voitures.length > 0 ? (
                this.state.voitures.map((voiture, index) => (
                  <tr key={index}>
                    <td>{voiture.marque}</td>
                    <td>{voiture.modele}</td>
                    <td>{voiture.couleur}</td>
                    <td>{voiture.annee}</td>
                    <td>{voiture.prix}</td>
                  </tr>
                ))
              ) : (
                <tr align="center">
                  <td colSpan="5">Aucune Voiture n’est disponible</td>
                </tr>
              )}
              {/* Affichage du nombre de voitures disponibles */}
              <tr align="center">
                <td colSpan="5">
                  {this.state.voitures.length} Voiture(s) disponible(s)
                </td>
              </tr>
            </tbody>
          </Table>
        </Card.Body>
      </Card>
    );
  }
}
